import styles from './SearchBar.module.css'

export default function SearchBar(props) {
   console.log(props)
   const {onSearch} = props
   return (
      <div className={styles.divBuscador}>
      <input type='search' />
      <button onClick={() => onSearch()}>Agregar</button>
      </div>
   );
}
